import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './nav.css';

function Nav(props) {
  const linkTitle = props.titles;
  const linkTitles = linkTitle.map((link) =>
    <li>
      <a class='nav-link' key={link.title}>
        {link.title}
        {console.log(link.title)}
      </a>
    </li>
  );

  return (
    <div class="navbar">
        <ul class="nav">
          {linkTitles}
        </ul>
      </div>
  );
}

export default Nav;
